<!DOCTYPE html>
<html lang="en">
<title>Site Maintenance</title>
<style>

	svg[title~="frame"] {
		@media screen and (max-width: 960px) {
			width: 270px;
			height: 180px;
		}

		@media screen and (max-width: 600px) {
			width: 270px;
			height: 180px;
		}
	}
  
	

  header {
	background-color: #2e2e38;
    height: 56px;
    margin: 0;
    display: flex;
    align-items: center;
	
	.logo-image {
	    padding-left: 20px;
		padding-right: 15px;
	}
	
	.header-iml {
		font-family: 'EYInterstate';
		display: flex;
		padding-top: 25px;
		
		font-style: normal;
		font-weight: 300;
		font-size: 17px;
		padding-bottom: 5px;
		line-height: 2rem;
		
		.header-text {
			display: inline-block;
			font-size: 1.07rem;
			color: #FFFFFF;
			font-weight: 300;
			line-height: 0.79rem;
			
			@media screen and (max-width: 600px) {
				display:none;
			}
		}
	
		.header-client{
		    border-left: 1px solid;
			
			padding-left: 8px;
			margin-left: 8px;
			color: #E1E1E6;
			
			font-style: normal;
			font-weight: 300;
			font-size: 14px;
			line-height: 17px;
			
			@media screen and (max-width: 600px) {
				padding-left: unset;
				margin-left: unset;
				border-left: unset;
			}
		}
	}
  }
  
  body {
	font-family: 'EYInterstate';
	text-align: center;
	margin: 0px;
	
	.eymp-h1 { 
		font-style: normal;
		font-weight: 400;
		font-size: 2rem;
		
		@media screen and (max-width: 960px) {
			font-size: 1.5rem;
		}

		@media screen and (max-width: 600px) {
			font-size: 2rem;
		}
		
	}
		
	.eymp-span {
		font-style: normal;
		font-weight: 300;
		font-size: 1rem;

		.link {
			font-weight: 700;
			color: #155CB4;
		}
		
		@media screen and (max-width: 960px) {
			font-size: .8rem;
			line-height: 1rem;
		}

		@media screen and (max-width: 600px) {
			font-size: 1.5rem;
			line-height: 2rem;
		}
	}
	
	.article-container {
		margin: auto;
		padding-top: 120px;
		font-style: normal;
		font-weight: 400;
		font-size: 28px;
		line-height: 32px;
		
		color: #23232F;
		width: 442px;
		
		@media screen and (max-width: 960px) {
			padding-top: 30px;
		}
		
		.article-footer {
			line-height: 2rem;
		}
	}
  }

</style>
